import React from 'react';
import logo from './logo.png'
import './Header.css';

export default class Header extends React.Component {
    constructor(props) {
        super(props);
        
        this.trees = {
            "BST" : "Binary Search Tree",
            "AVL" : "AVL Tree",
            "RBT" : "Red-Black Tree",
            "BHP" : "Binary Heap"
        };

        this.state = {
            active: "BST"
        };
    }

    render() {
        return (
            <>
                <div id="header-wrapper">
                    <span className="header-logo"><img src={logo} alt="logo" /></span>
                </div>
            </>
        );
    }
}
